import React from 'react'

import { MyButton } from '../UI/button/MyButton'


const statusesArr = ['active', 'in progress', 'urgent', 'done']

const test = statusesArr.filter(status => status !== 'done').map(status => status)

console.log(test)

export const Statuses = () => {
  return (
    <div>
      {
        statusesArr.filter(status => status !== 'done').map(status => <MyButton>{status}</MyButton>)
      }
      <MyButton/>
    </div>
  )
}
